msg.payload = {};
msg.payload.url = "/watermap";
msg.payload.command = {};

msg.payload.command =   {
                        layer:"OSM Grey",
                        lat:41.0555556,
                        lon:-74.1197222,
                        zoom:5,
                        map: { name: "OSM Grey" }
                        };
return msg;

// Add some simple-spec styling to this polygon area
var properties = { 
    "stroke" : "aqua",
    "stroke-width": 5,
    "fill": "#00FFFF",
    "fill-opacity": 0.4
}
msg.payload.features[0].properties = properties;

msg.payload = { name: "SaddleRiverWaterBasin",
                layer:"SaddleRiverWaterBasin",
                geojson:msg.payload
              };    
return msg;

// Add some simple-spec styling to this polygon area
var properties = { 
    "stroke" : "maroon",
    "stroke-width": 5,
    "fill": "maroon",
    "fill-opacity": 0.4
}
msg.payload.properties = properties;

msg.payload = { name: "Ridgewood",
                layer:"Ridgewood",
                geojson:msg.payload
              };    
return msg;

// Add some simple-spec styling to this polygon area
var properties = { 
    "stroke" : "blue",
    "stroke-width": 5,
    "fill": "#0000FF",
    "fill-opacity": 0.4
}
msg.payload.features[0].properties = properties;

msg.payload = { name: "HohokusWaterBasin",
                layer:"HohokusWaterBasin",
                geojson:msg.payload
              };    
return msg;

var toxins = msg.payload.contaminantDetails;

// Highlight toxins that exceed EPA limits
for( var i=0; i < toxins.length; i++) {
    if( parseFloat(toxins[i].sample_amount) > parseFloat(toxins[i].toxin_limit_value) ) {
        toxins[i].toxin_type_name = "<font color='red'><b>"+toxins[i].toxin_type_name+"</b></font>";
        toxins[i].sample_amount = "<font color='red'><b>"+toxins[i].sample_amount+"</b></font>";
    }
}
msg.payload = toxins;
return msg;
